import React from 'react';

import { Footer } from 'react-materialize';
import Grid from '@material-ui/core/Grid';




const footer = (props) => (

    <Footer
    className="example"
    copyrights="Copyright Â© Dronaar 2020, All Rights Reserved"
    links={<ul><li><a className="grey-text text-lighten-3" href="#!">Link 1</a></li><li><a className="grey-text text-lighten-3" href="#!">Link 2</a></li><li><a className="grey-text text-lighten-3" href="#!">Link 3</a></li><li><a className="grey-text text-lighten-3" href="#!">Link 4</a></li></ul>}
    moreLinks={<a className="grey-text text-lighten-4 right" href="#!">More Links</a>}
  >
      <Grid container>
          <Grid item lg={2}></Grid>
          <Grid container lg={8}>
              <Grid item lg={4}><h5 className="white-text">
      Footer Content
    </h5></Grid>
              <Grid item lg={4}></Grid>
              <Grid item lg={4}></Grid>
          </Grid>
      </Grid>
    
    
  </Footer>
    
    );
    
    export default footer;
